(272600, '0', 'Leiden', 'Leiden', '', '000698', '00_000', '698', '', '767', 'C', '', 'Shelfmark Or. 875/2 on p. 368 of http://www.islamicmanuscripts.info/inventories/leiden/or01000.pdf gives Latin catalogue refs as CCA 698 vol I, p.430-1 but CCO 596, vol 2, p. 74-5. For CCO 596 (NOT 698) see http://menadoc.bibliothek.uni-halle.de/ssg/content/zoom/802559 . This is RN\'s manuscript \'L\' in his edition of the Tarjuman. For CCA 698 see http://books.google.co.uk/books?id=GygVAAAAIAAJ&amp;pg=PA430&amp;dq=%22Catalogus+Codicum+Arabicorum%22+DCXCVIII&amp;hl=en&amp;sa=X&amp;ei=ayfmUpPxMtTH7Aa_xYGwBA&amp;ved=0CD8Q6AEwAA#v=onepage&amp;q=%22Catalogus%20Codicum%20Arabicorum%22%20DCXCVIII&amp;f=false. Note that there is also a copy of RG 116 (the commentary) unrecorded by OY in Leiden Or. 641 (which is RN\'s manuscript \'M\') - see p. 270 of http://www.islamicmanuscripts.info/inventories/leiden/or01000.pdf and hence CCO 597 at http://menadoc.bibliothek.uni-halle.de/ssg/content/zoom/802560', '(?)', '0235', '0395', '000698'),
